# Dmitriyevka, Nordovsky Selsoviet, Meleuzovsky District, Republic of Bashkortostan

}}
Dmitriyevka () is a rural locality (a village) in Nordovsky Selsoviet, Meleuzovsky District, Bashkortostan, Russia. The population was 356 as of 2010.
Geography
It is located 32&nbsp;km from Meleuz, 10&nbsp;km from Nordovka.
